: tcp://127.0.0.1:43149 &lt;/li&gt;\n          &lt;li&gt; Workers: 10 &lt;/li&gt;\n          &lt;li&gt; Threads: 10 &lt;/li&gt;\n          &lt;li&gt; Memory: 540.94 GB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.03.0+27.g82fcaab0 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.03.0+13.g4898d39e &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef main():\n    client = Client(n_workers=10, threads_per_worker=1)\n    print(client)\n\n    df = dask.datasets.timeseries(\n        start=\"2000-01-01\",\n        end=\"2000-01-31\",\n        # end=\"2000-12-31\",\n        partition_freq=\"1h\",\n        freq=\"60s\",\n    )\n    df = df.persist()\n    wait(df)\n    iterations = 10\n\n    with performance_report(filename=f\"{today}-simple-scheduler.html\"):\n        simple = []\n        # print('start simple: ', flush=True)\n        for i in range(iterations):\n            start = time.monotonic()\n            z = df.x + 1 + 2 - df.y\n            z.sum().compute()\n            stop = time.monotonic()\n            simple.append(stop - start)\n        simple = np.array(simple)\n\n    df2 = None\n    with performance_report(filename=f\"{today}-shuffle-scheduler.html\"):\n        shuffle_t = []\n        # print('start shuffle: ', flush=True)\n        for i in range(iterations):\n            client.cancel(df2)\n            start = time.monotonic()\n            # shuffle(df, \"id\", shuffle=\"tasks\")\n            df2 = df.set_index(\"id\").persist()\n            wait(df2)\n            stop = time.monotonic()\n            shuffle_t.append(stop - start)\n        shuffle_t = np.array(shuffle_t)\n\n    with performance_report(filename=f\"{today}-rand-access-scheduler.html\"):\n        rand_access = []\n        for i in range(iterations):\n            start = time.monotonic()\n            df2.head()\n            stop = time.monotonic()\n            rand_access.append(stop - start)\n        rand_access = np.array(rand_access)\n    data = dsa.random.random((10000, 1000000), chunks=(1, 1000000))\n    da = xr.DataArray(data, dims=['time', 'x'],\n                      coords={'day': ('time', np.arange(10000) % 100)})\n    clim = da.groupby('day').mean(dim='time')\n    anom = da.groupby('day') - clim\n    anom_mean = anom.mean(dim='time')\n    with performance_report(filename=f\"{today}-anom-mean-scheduler.html\"):\n        anom_mean_t = []\n        for i in range(iterations):\n            start = time.monotonic()\n            anom_mean.compute()\n            stop = time.monotonic()\n            anom_mean_t.append(stop-start)\n\n        anom_mean_t = np.array(anom_mean_t)\n\n    return dict(simple=simple, shuffle=shuffle_t, rand_access=rand_access,\n            anom_mean=anom_mean_t)\n\n        &lt;/pre&gt;\n        "},"id":"1209","type":"Div"},{"attributes":{},"id":"1278","type":"Selection"},{"attributes":{"below":[{"id":"1047"}],"center":[{"id":"1050"},{"id":"1054"}],"left":[{"id":"1051"}],"renderers":[{"id":"1068"}],"sizing_mode":"stretch_both","title":{"id":"1224"},"toolbar":{"id":"1060"},"x_range":{"id":"1039"},"x_scale":{"id":"1043"},"y_range":{"id":"1041"},"y_scale":{"id":"1045"}},"id":"1038","subtype":"Figure","type":"Plot"},{"attributes":{},"id":"1220","type":"Title"},{"attributes":{},"id":"1087","type":"BasicTicker"},{"attributes":{"child":{"id":"bk-bandwidth-type-plot"},"title":"Bandwidth (Types)"},"id":"1216","type":"Panel"},{"attributes":{},"id":"1010","type":"LinearScale"},{"attributes":{"formatter":{"id":"1237"},"major_label_policy":{"id":"1238"},"ticker":{"id":"1013"},"visible":false},"id":"1012","type":"LinearAxis"},{"attributes":{"data_source":{"id":"1177"},"glyph":{"id":"1198"},"hover_glyph":null,"muted_glyph":null,"nonselection_glyph":null,"view":{"id":"1201"}},"id":"1200","type":"GlyphRenderer"},{"attributes":{"callback":null,"point_policy":"follow_mouse","tooltips":"\n            &lt;div&gt;\n                &lt;p&gt;&lt;b&gt;Source:&lt;/b&gt; @source
